import pytest
from handler import detect_damage
from requests_toolbelt.multipart import decoder


damage_image = ''

whole_car = ''


def test_handler():
    event = {
        'headers': {'content-type': 'multipart/form-data; boundary=X-INSOMNIA-BOUNDARY'},
        'body': damage_image,
    },
    damage_res = detect_damage(event, '')
    assert damage_res['predicted'] == '00-damage'
    event = {
        'headers': {'content-type': 'multipart/form-data; boundary=X-INSOMNIA-BOUNDARY'},
        'body': whole_car,
    }
    whole_res = detect_damage(event, '')
    assert whole_res['predicted'] == '01-whole'

